  //       }
  //     );
  //   } else {
  //     console.error('Geolocation is not supported by this browser.');
  //   }
  // }, []);

  const data = [
    '/images/1.jpeg',
    '/images/2.jpeg',
    '/images/3.jpeg',
    '/images/4.jpeg',
    '/images/5.jpeg',
    '/images/6.jpeg',
    '/images/7.jpeg',
    '/images/8.jpeg',
  ];

  return (
    <div>
      {!map ? (
        <Form className="searchP">
          <iframe
            width="100%"
            height="300"
            title="Google Map Embed"
            id="map-iframe"
            src=""
            style={{ border: '0' }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
          <div className="mb-3 searchbar">
            <SearchBar bg={true} />
          </div>
        </Form>
      ) : (
        <div style={{width:"100%"}}>
          {data.map((item, index) => (
            <div key={index}>
              <img src={item} alt="" style={{width:"100%"}}/>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Map;
